    const fetchRecords = async () => {
        const recordsCollection = collection(firestore, 'records');
        const recordsDocs = await getDocs(recordsCollection);
        const fetchedRecords: any[] = [];
        recordsDocs.forEach((doc) => {
          const data = doc.data();
          const date = new Date(data.date.seconds * 1000); // Convert Unix timestamp to JavaScript Date object
          let monthName = date.toLocaleDateString('it-IT', { month: 'long' }); // Get the month name
          monthName = capitalizeFirstLetter(monthName); // Capitalize the first letter of the month name
          data.date = `${date.getDate()} ${monthName}`; // Set the date to 'DD Month' format
          const dateMod = new Date(data.dateMod.seconds * 1000); // Convert Unix timestamp to JavaScript Date object
          const year = dateMod.getFullYear();
          const month = ("0" + (dateMod.getMonth() + 1)).slice(-2); // Months are 0-based in JavaScript
          const day = ("0" + dateMod.getDate()).slice(-2);
          const hours = ("0" + dateMod.getHours()).slice(-2);
          const minutes = ("0" + dateMod.getMinutes()).slice(-2);
    
          data.dateMod = `${year}/${month}/${day} ${hours}:${minutes}`; // Set the date to 'YYYY/MM/DD hh:mm' format
    
          fetchedRecords.push(data);
        });
        setRecords(fetchedRecords);
        ////console.log(fetchedRecords)
      };
    
