    const GetAll = async () => {
        setLoadingPDFandSW(true);
    
        try {
            // First request to get the initial ZIP file with folder structure
            const response = await axios.post(urla.toString() + 'batchOperations', { mappings }, {
                responseType: 'blob',
            });
    
            const contentType = response.headers['content-type'];
    
            if (contentType && contentType.includes('application/json')) {
                // Handle JSON response (error)
                const reader = new FileReader();
                reader.onload = () => {
                    const text = reader.result;
                    if (text) {
                        const json = JSON.parse(text.toString());
                        showErrorToast(`${json.message}`);
                    }
                };
                reader.readAsText(response.data);
            } else if (response.status === 200) {
                // Handle successful ZIP download
                const url = window.URL.createObjectURL(new Blob([response.data]));
                const currentDate = new Date();
                const formattedDate = `${currentDate.getFullYear()}-${currentDate.getMonth() + 1}-${currentDate.getDate()}`;
    
                const link = document.createElement('a');
                link.href = url;
                link.setAttribute('download', `SW_BackUp_${formattedDate}.zip`);
                
                document.body.appendChild(link);
                link.click();
                link.remove();
    
                // Wait for the download to be completed before revoking the URL and calling the next function
                await new Promise((resolve) => setTimeout(resolve, 1000)); // Wait 1 second for download to complete
                window.URL.revokeObjectURL(url);
    
                // Now, call the generatePDFReports function to create the second ZIP file
                generatePDFReports();
            } else {
                showErrorToast(`Failed to download files, try again`);
            }
        } catch (error: any) {
            if (error.response && error.response.data) {
                const reader = new FileReader();
                reader.onload = () => {
                    const text = reader.result;
                    if (text) {
                        const json = JSON.parse(text.toString());
                        showErrorToast(`${json.message}`);
                    }
                };
                reader.readAsText(error.response.data);
            } else {
                showErrorToast(`${error.message}`);
            }
        } finally {
            // Ensure the loading state is set to false only after the second function runs
            setLoadingPDFandSW(false);
        }
    };
    
    

    const generatePDFReports = async () => {
        setLoadingPDFandSW(true);
    
        const records = filterAndGroupRecords(Records);
        //console.log(records);
        // Check if there are any records to process
        if (Object.keys(records).length < 1) {
            showErrorToast('Nessuna assistenza per questa combinazione, riprova');
            setLoadingPDFandSW(false);
            return;
        }
    
        try {
            const zip = new JSZip(); // Initialize a new JSZip instance
    
            // Loop through each 'macchina' group and create individual PDF reports
            for (const macchina of Object.keys(records)) {
                const doc = new jsPDF('landscape');
                let previousMacchina = ''; // Variable to track the previous machine
                let macchinaRecords = records[macchina];
    
                // Sort the records by date or any other field you prefer
                macchinaRecords.sort((a: any, b: any) => new Date(a.dateMod).getTime() - new Date(b.dateMod).getTime());
    
                // Header for each 'macchina' if it's different from the previous one
                if (previousMacchina !== macchina) {
                    doc.setFontSize(36);
                    doc.text(`Report Assistenza`, 140, 40);
    
                    // Table for general machine info (e.g., Commessa, Cliente, Macchina)
                    autoTable(doc, {
                        startY: 70,
                        columnStyles: { europe: { halign: 'left' } },
                        body: [
                            { commessa: macchinaRecords[0].commessa, cliente: macchinaRecords[0].cliente, macchina: macchina },
                        ],
                        columns: [
                            { header: 'Commessa', dataKey: 'commessa' },
                            { header: 'Cliente', dataKey: 'cliente' },
                            { header: 'Macchina', dataKey: 'macchina' },
                        ],
                    });
    
                    previousMacchina = macchina; // Update the previous machine tracker
                }
    
                // Compact all records for the current 'macchina' into a single table
                const bodyData = macchinaRecords.map((record: any) => {
                    const data = record.date;
                    const oreLav = record.oreLavorate;
                    const note = record.note;
                    const tecnico = record.tecnico;
                    const problema = record.problem;
                    const tecnicoCliente = record.tecnicoCliente;
                    let intervento = record.tipoIntervento;
    
                    // Mapping of 'intervento' codes to strings
                    switch (intervento) {
                        case "0":
                            intervento = "Assistenza";
                            break;
                        case "1":
                            intervento = "Non risolutivo";
                            break;
                        case "2":
                            intervento = "Non risolutivo (Urgente)";
                            break;
                        case "3":
                            intervento = "Risolutivo";
                            break;
                    }
    
                    return {
                        data: data,
                        tecnicoCliente: tecnicoCliente,
                        problema: problema,
                        tecnico: tecnico,
                        ore: oreLav,
                        intervento: intervento,
                        note: note
                    };
                });
    
                // Add the machine logo or image
                doc.addImage(img, 'JPEG', 15, 15, 67, 40);
    
                // Create a single table for all records in the 'macchina' group with padding after the image
                autoTable(doc, {
                    startY: 90, // Adjust this value to add more padding between the image and the table
                    columnStyles: { europe: { halign: 'left' } },
                    body: bodyData, // Add all records to the table's body
                    columns: [
                        { header: 'Data richiesta', dataKey: 'data' },
                        { header: 'Tecnico Cliente', dataKey: 'tecnicoCliente' },
                        { header: 'Problema segnalato', dataKey: 'problema' },
                        { header: 'Tecnico Interno', dataKey: 'tecnico' },
                        { header: 'Ore Lavorate', dataKey: 'ore' },
                        { header: 'Tipo intervento', dataKey: 'intervento' },
                        { header: 'Note', dataKey: 'note' },
                    ],
                });
    
                const today = new Date();
                const todayFormatted = `${today.getFullYear()}${("0" + (today.getMonth() + 1)).slice(-2)}${("0" + today.getDate()).slice(-2)}`;
    
                // Create a file name for the current machine's report
                const commessa = macchinaRecords[0].commessa.replace(/\s/g, '_'); // Replace spaces with underscores
                const cliente = macchinaRecords[0].cliente.replace(/\s/g, '_');   // Replace spaces with underscores
                const machineName = macchina.replace(/\s/g, '_');                 // Replace spaces with underscores
                const fileName = `${commessa}_${cliente}_${machineName}_${todayFormatted}.pdf`;
    
                // Add the PDF as a file to the ZIP archive
                const pdfBlob = doc.output('blob');
                zip.file(fileName, pdfBlob);
            }
    
            // Generate and download the ZIP file
            zip.generateAsync({ type: 'blob' }).then((content) => {
                const currentDate = new Date();
                const formattedDate = `${currentDate.getFullYear()}-${currentDate.getMonth() + 1}-${currentDate.getDate()}`;
                const zipFileName = `Reports_BackUp_${formattedDate}.zip`;
    
                const link = document.createElement('a');
                link.href = window.URL.createObjectURL(content);
                link.setAttribute('download', zipFileName);
                document.body.appendChild(link);
                link.click();
                link.remove();
                window.URL.revokeObjectURL(link.href);
    
                setLoadingPDFandSW(false);
            });
        } catch (error) {
            showErrorToast('Error generating PDF reports, try again');
            setLoadingPDFandSW(false);
        }
    };

    
    
    

